import { Card } from 'antd';
import SelectUI from './SelectUI';


const CardUI = ({onSelect}) => {
    const extra = () => {
        return (
            <SelectUI onSelect={onSelect}/>
            )
        }
    return (
        <>
            <Card title="Total" extra={() => extra()} style={{ width: 500 }}>
            </Card>
        </>
    );
}

export default CardUI
